import React from "react";
import {Document, Page} from "react-pdf";

const CoverPage = () => {
    return(<div>
        <Document file="./Files/CoverLetter.pdf">
            <Page pageNumber={1} />
        </Document>
    </div>)
}

export default CoverPage;
